import React from 'react';
import './App.css';
import cards from './data/card.json';
import { useState } from "react";

function App() {
  const [cardState, setCardState] = useState(cards.type);

  return (
    <div className="App">
      <div className="card">
        This card is a(n) {cardState}.
      </div>
      <button onClick={() => setCardState("King")}></button>
    </div>
  );
}

export default App;
